package main

import (
	"fmt"
	"strconv"
)

func Hex2Dec(val string) int {
	n, err := strconv.ParseUint(val, 16, 64)
	if err != nil {
	fmt.Println(err)
}
	return int(n)
}


func main() {
	hex := "00000000000000000000000000000000000000000000a2bc77ee287ecf500000"
	dec := Hex2Dec(hex)
	fmt.Println(dec)
}

